import React from 'react';
import { Row, Col} from 'react-bootstrap';

import products from '../products';

function HomeScreen() {
    return(
        <div>
            <h1>Latest product</h1>
            <Row>
                {products.map(prod => (
                    <Col key={prod._id} sm={12} md={6} Lg={4} xL={3}>
                    <h3>{prod.name}</h3>
                    </Col>
                ))}
            </Row>
        </div>
    );
};

export default HomeScreen;
